import React, { Component} from 'react';
import {Row, Col } from 'antd';
import './Navbar.css';

class Navbar extends Component {
    constructor(props){
        super(props)
    }

    render(){
        return(
            <div className="navbar-container">
               <Row>
                    <Col xs={24}>
                        <div className="navbar-container">
                            <Row>
                                <Col xs={10}>
                                    <div>
                                        <Row>
                                            <Col xs={10}>
                                                <div></div>
                                            </Col>
                                            <Col xs={14}>
                                            <div></div>
                                            </Col>
                                        </Row>
                                    </div>
                                </Col>
                                <Col xs={14}>
                                    
                                </Col>
                            </Row>
                        </div>
                    </Col>
               </Row>
            </div>
        )
    }
}
export default Navbar;
